import { Component } from 'react';
import header from '../Components/header/header';

class Login extends Component(){
    constructor(props){
        super(props);
        this.state = {
            email : '',
            senha : '',
            idUsuario : 0,
            idTipoUsuario : 0,
            erroMensagem : '',
            isLoading : false
        }
    }

    
}
